import React from 'react'

const UsersList = ({users}) => {
	return (
		<Card>
			<ul>
				{users.map(user => (
					<li key={user.id}>{user.name} is ({user.age}) years old.</li>
				))}
			</ul>
		</Card>
	)
}

export default UsersList
